import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import {BrowserRouter as Router,Switch,Route,Link } from "react-router-dom";

function App() {
  return (
    <Router>
    <Topbar/>
    <Switch>
        <Route exact path="/">
             <Home/>
        </Route>
        <Route path="/register">
             <Register/>
        </Route>
    </Switch>



    </Router>
  );
}

export default App;
